import { useEffect } from "react";
import { Button, Card, CardBody, CardFooter, CardHeader, CardImg } from "react-bootstrap";

function NewsCard({newsitem}){

 // const [content, publishedAt, urlToImage, url, description, title, author, source] = newsitem;
 useEffect(()=>{
      console.log(newsitem);
  }, []);
    return(
        <>
            {

                <Card>
                <CardHeader>
                <h5 style={{fontFamily:"inherit"}}>{newsitem.title}</h5>
                </CardHeader>
                <CardImg variant="top" src={newsitem.urlToimage}> </CardImg>
                <CardBody>
                <p>
                {newsitem.description}
                    </p>
                    </CardBody>
                    <CardFooter>
                    <p>
                    {newsitem.author}<br/>
                    {newsitem.publishedAt}
                    </p>
                    <Button variant="primary" href={newsitem.url}></Button>
                    </CardFooter>
                    </Card>
                }
            </>
        );
}

export default NewsCard;
